IF NOT EXISTS (SELECT * FROM sys.databases WHERE name = 'liquorSales')
BEGIN
    CREATE DATABASE liquorSales;
END
GO
USE liquorSales;
GO


IF OBJECT_ID('dbo.finance_liquor_sales', 'U') IS NOT NULL
    DROP TABLE dbo.finance_liquor_sales;
GO

CREATE TABLE finance_liquor_sales (
  invoice_and_item_number NVARCHAR(MAX),
  date DATETIME DEFAULT NULL,
  store_number INT DEFAULT NULL,
  store_name NVARCHAR(MAX),
  address NVARCHAR(MAX),
  city NVARCHAR(MAX),
  zip_code NVARCHAR(MAX),
  store_location NVARCHAR(MAX),
  county_number INT DEFAULT NULL,
  county NVARCHAR(MAX),
  category FLOAT DEFAULT NULL,
  category_name NVARCHAR(MAX),
  vendor_number INT DEFAULT NULL,
  vendor_name NVARCHAR(MAX),
  item_number INT DEFAULT NULL,
  item_description NVARCHAR(MAX),
  pack INT DEFAULT NULL,
  bottle_volume_ml INT DEFAULT NULL,
  state_bottle_cost FLOAT DEFAULT NULL,
  state_bottle_retail FLOAT DEFAULT NULL,
  bottles_sold INT DEFAULT NULL,
  sale_dollars FLOAT DEFAULT NULL,
  volume_sold_liters FLOAT DEFAULT NULL,
  volume_sold_gallons FLOAT DEFAULT NULL
)

GO



